import React from 'react';
import ChemistryImage from './images/chemistry.jpg';
import PhysicsImage from './images/physics.jpg';
import MathsImage from './images/maths.jpg';

function App() {
  return (
    <div>
      <img src={ChemistryImage} alt="Chemistry" />
      <img src={PhysicsImage} alt="Physics" />
      <img src={MathsImage} alt="Maths" />
    </div>
  );
}

export default App;
